import logo from './logo.svg';
import './App.css';
require('isomorphic-fetch');
var Dropbox = require('dropbox').Dropbox;


const renderDropBoxList = async ()=> {

  // Create an instance of Dropbox with the access token and use it to
  // fetch and render the files in the users root directory.
  var dbx = new Dropbox({ accessToken:'sl.BTM8p1hUryxLBE7t78zRbtqGQcxqXTXxED0-htBMWx8jYshBX0HCWmXPyqacpwtqwDkwHVazHw7AmMFVLxZpuXPEENcTC0Gekm7rkcaAVu7-Qij0sMqM6lpZUpp6VbQPSYdP_UDuVQEr' });
  dbx.filesListFolder({path: ''})
    .then(function(response) {
      console.log(response.result.entries);
    })
    .catch(function(error) {
      console.error(error);
    });
}

function App() {
  renderDropBoxList()


  return (
    <div className="App">
      <header className="App-header">
        Dashboard
      </header>



    </div>
  );
}

export default App;
